// All credits to me 9808us :-)

/* RSI can be calculated in various way. Here I propose a way that matches Tradingview rsi(close, 14) */

// First of all we check for record.previous if exists
if (record.previous == undefined || record.previous == NaN) {
    record.previous = record.current
}


// Set some vars to easily tweak the calc

let srcRSI = record.current.close           // Default is close but you can get exhotic and set high ...
let srcRSIprev = record.previous.close      // Usually in sync with the above var
let lenRSI = 8                             // Default RSI periods
let lenStoch = 14                           // Default StochRSI periods
let smoothK = 3                             // Periods for K calc
let smoothD = 3                             // Periods for D calc

maxUp = Math.max(srcRSI - srcRSIprev, 0).toFixed(2)
maxDown = Math.max(srcRSIprev - srcRSI, 0).toFixed(2)

maxUpRMA = calcRMA(maxUp, lenRSI, prevMaxUpRMA)
prevMaxUpRMA = maxUpRMA

maxDownRMA = calcRMA(maxDown, lenRSI, prevMaxDownRMA)
prevMaxDownRMA = maxDownRMA

/* Calc RMA */
function calcRMA(src, len, prevRMA) {    // source, lenght
    let alpha = 1 / len
    src = Number(src)   // Make sure we work with numbers
    if (prevRMA == undefined || isNaN(prevRMA)) { prevRMA = 0 }
    rma = alpha * src + (1 - alpha) * prevRMA
    return rma
}

/* Calc Relative Strenght - First check for possible issues with maxDownRMA */
if (maxDownRMA > 0) {
    rs = maxUpRMA / maxDownRMA
} else {
    rs = 0
}

/* Calculate RSI */
variable.rsi = 100 - 100 / (1 + rs)
variable.rsi = variable.rsi.toFixed(2)

// Let's built an array with RSI values and keep it the correct size to calc MAX and MIN values
variable.lastRSI.push(variable.rsi)
if (variable.lastRSI.length > lenStoch) {
    variable.lastRSI.splice(0, 1) // Keep the array the correct size
}

// Calc Max and Min of array lastRSI
maxRSI = calcMAX(variable.lastRSI, lenStoch)
minRSI = calcMIN(variable.lastRSI, lenStoch)

function calcMAX(arr, len) {
    if (arr.length < len) { return 0 }
    return Math.max(...arr)
}

function calcMIN(arr, len) {
    if (arr.length < len) { return 0 }
    return Math.min(...arr)
}

// Define StochRSI - No need to specify lenStoch here as it is taken into account when calc MAX MIN
variable.stochRSI = calcStoch(variable.rsi, maxRSI, minRSI)
variable.stochRSI = Number(variable.stochRSI)

// Build last Stoch array to calc sma
variable.lastStochRSI.push(variable.stochRSI)
if (variable.lastStochRSI.length > smoothK) {
    variable.lastStochRSI.splice(0, 1) // Keep the array the correct size
}

/* Calc Stoch function */
function calcStoch(src, highest, lowest) {

    if (highest - lowest > 0) {

        let stoch = 100 * (src - lowest) / (highest - lowest)

        return stoch.toFixed(2)

    } else

        return 0
}

// In Tradingview K and D are SMA with periods smoothK and smoothD
variable.valueK = calcSMA(variable.lastStochRSI, smoothK)

// Build last K array to calc sma
variable.valueLastK.push(variable.valueK)
if (variable.valueLastK.length > smoothD) {
    variable.valueLastK.splice(0, 1) // Keep the array the correct size
}

/* Define D */
variable.valueD = calcSMA(variable.valueLastK, smoothD)

/* SMA function */
function calcSMA(src, periods) { 

    if (src.length < periods) { return 0 }  // Check we have enough values to make the calc

    let sum = 0
    for (let i = src.length - periods; i < src.length; i++) {

        src[i] = Number(src[i])         // Make sure we work with numbers
        sum = sum + src[i]

    }

    let sma = sum / periods
    return sma.toFixed(2)
}

let candle = record.current
let len = 20 //length for moving average calculation
let P = 60 //number of periods for MA - close moving averag and standard deviation
let up = 2 //upper band multiplier
let low = 2 //lower band multiplier


//store close values for MA calculation
variable.lastClose.push(candle.close)
if(variable.lastClose.length > len){
	variable.lastClose.splice(0,1)
}
//MA calculation
if(variable.lastClose.length === len){
	variable.sum = 0
	for(var i = 0 ; i < len ; i++){
		variable.sum += variable.lastClose[i]
	}
	variable.MA = variable.sum / len
}else{
	variable.MA = candle.close
}

//MADI calculation
variable.D = candle.close - variable.MA
variable.diff.push(variable.D)
if(variable.diff.length > P){
	variable.diff.splice(0,1)
}

if(variable.diff.length === P){
	variable.sum = 0
	for(var i = 0 ; i < P ; i++){
		variable.sum += variable.diff[i]
	}
	variable.MADI = variable.sum / P
	variable.SQ = 0
	for(var i = 0 ; i < P ; i++){
		variable.SQ += Math.pow(variable.diff[i] - variable.MADI,2)
	}
	variable.sigma = Math.sqrt(variable.SQ / P)
}else{
	variable.MADI = variable.D
	variable.sigma = 0.01 * variable.MADI
}

variable.upper = variable.MADI + up * variable.sigma
variable.lower = variable.MADI - low * variable.sigma
